import React from 'react';
import ChooseArea from "../Components/ChooseArea/ChooseArea";
import FormRegister from "../Components/FormRegister/FormRegister";
import ManageArrow from "../Components/ManageArrow/ManageArrow";

const Check = () => {
    return (
        <>
            <div className={"head"}>
                Check Lab
            </div>

            <div className={"userDiv"}>

                <div className={"userChoose"} style={course.name.length<=0 ? {display: "none"} : {}}>
                    {course.name.length > 0 ? <div>{course.name} ({course.semester})</div> : null}
                    {group.length > 0 ? <div>{group}</div> : null}
                    {lab.length > 0 ? <div>{lab}</div> : null}
                </div>

                <div className={"chooseParentDiv"}>
                    <div className="inpDiv">
                        {pageChoose < 4 && <input className={"inpFilter"} placeholder={"Введите название..."} value={filter} onChange={(e) => setFilter(e.target.value)}/>}
                        {message && pageChoose === 4 && <div className={"mes"}>{message}</div>}
                    </div>

                    <div className={"chooseDiv"}>

                        <ChooseArea allOpt={allOpt} strfilt={filter} groups={groups} setGroup={setGroup} courses={courses} setCourse={setCourse} labs={labs} setLab={setLab}/>
                        <FormRegister fullUserData={fullUserData} setFullUserData={setFullUserData}/>
                        <div className="result">{result}</div>
                    </div>
                    <div className={"parentArrow"}>
                        <ManageArrow FUD={fullUserData} setFilter={setFilter} allOpt={allOpt} setPageChoose={setPageChoose} pageChoose={pageChoose} callback={callback}/>
                    </div>
                </div>
            </div>
        </>
    );
};

export default Check;
